INSERT INTO `attraction` (`attr_id`, `attr_title`, `attr_description`, `price_adult`, `price_child`, `address`, `latitude`, `longitude`, `opening_hrs`, `category_id`, `attr_image`, `attr_link`, `attr_POI`, `location_id`) VALUES
(1, 'Jurong Bird Park', 'Jurong Bird Park is a tourist attraction in Singapore managed by Wildlife Reserves Singapore. It is a landscaped park, built on the western slope of Jurong Hill. It is located within the Boon Lay Planning Area of the Jurong district and has an area of 202,000 square metres (50 acres).', 28, 18, '2 Jurong Hill Singapore 628925', 1.318100, 103.707199, 'Daily, 8.30am to 6.00pm', 'ZOO', 'JurongBirdParks.jpg', 'http://www.birdpark.com.sg/', NULL, 'NE'),
(2, 'Night Safari', 'The Night Safari is the world''s first nocturnal zoo and is one of the most popular tourist attractions in Singapore.The Night Safari currently houses over 2,500 animals representing over 130 species, of which 38% are threatened species. The Night Safari is managed by Wildlife Reserves Singapore, and about 1.1 million visitors visit the safari per year. The Night Safari received its 11 millionth visitor on 29 May 2007.', 42, 28, '80 Mandai Lake Road Singapore 729826', 37.826237, -122.156982, 'Daily, 7.30pm to 12.00mn', 'ZOO', 'NightSafari.jpg', 'http://www.nightsafari.com.sg/', NULL, 'NE'),
(3, 'River Safari', 'The River Safari is a river-themed zoo and aquarium located in Singapore. It is built over 12 hectares (30 acres) and nestled between its two counterparts, the Singapore Zoo and the Night Safari. It is the first of its kind in Asia and features freshwater attractions and river boat rides as its main highlights. \r\nThe safari was built at a cost of S$160m, with an expected visitor rate of 820,000 people yearly.The Giant Panda Forest was opened to the public on 29 November 2012, with a soft opening on 3 April 2013, attracting close to 1,500 visitors. This attraction is the fourth zoo in Singapore, along with the Singapore Zoo, Jurong Bird Park, and Night Safari, all of which are managed by Wildlife Reserves Singapore.', 28, 18, '80 Mandai Lake Road Singapore 729826', 1.403522, 103.789452, 'Daily, 9.00am to 6.00pm', 'ZOO', 'RiverSafari.jpg', 'http://riversafari.com.sg/', NULL, 'NE'),
(4, 'Singapore Zoo', 'The Singapore Zoo, formerly known as the Singapore Zoological Gardens and commonly known locally as the Mandai Zoo, occupies 28 hectares (69 acres) on the margins of Upper Seletar Reservoir within Singapore''s heavily forested central catchment area. The zoo was built at a cost of S$9m granted by the government of Singapore and opened on 27 June 1973. \r\nIt is operated by Wildlife Reserves Singapore, who also manage the neighbouring Night Safari and the Jurong BirdPark. There are about 315 species of animal in the zoo, of which some 16 percent are considered threatened species. The zoo attracts about 1.6 million visitors each year.', 32, 21, '80 Mandai Lake Road Singapore 729826', 1.404132, 103.793053, 'Daily, 8.30am to 6.00pm', 'ZOO', 'SingaporeZoo.jpg', 'http://www.zoo.com.sg/', NULL, 'NE'),
(5, '313@somerset', 'One-stop haven for shopaholics\r\n\r\nFast becoming one of the most popular shopping destinations in the Orchard Road belt, 313@somerset is situated right above the Somerset MRT station and boasts well-known fashion brands as well as great dining options.\r\n\r\nSpread over a sprawling eight storeys, ladies will enjoy the trendy and varied designs available at Forever 21’s flagship store, meeting the guys later at Cotton On to shop for basics, or Zara for designs from contemporary European designers. Upstairs, you’ll be spoilt for choice at Uniqlo, with its fashionable clean-cut lines and friendly service.\r\n\r\nWhen you need a break, stop for a meal upstairs at Food Republic and select from a range of local favourites, or head downstairs to Swiss eatery Marché to enjoy a superb selection of salads, homemade pastas, rostis, rotisserie chicken, traditional Swiss breads, tarts and more. With so many stores, dining spots and cafes available here, you’ll need at least a full day to explore 313@somerset.', 0, 0, '313 Orchard Road Singapore 238895', 1.301259, 103.838562, 'Sunday - Thursday: 10am - 10pm\r\nFriday & Saturday: 10am - 11pm', 'SHOP', '313Somerset.jpg', 'www.313somerset.com.sg/', NULL, 'CEN'),
(6, 'Bugis Junction', 'Variety is the spice of life\r\n\r\nBugis Junction has a mixture of shopping options to enthral even the most seasoned of shoppers. Part traditional mall, part open-air shopping district, Bugis Junction is one of the few malls in Singapore that has sidewalk cafes and shophouses sitting alongside gleaming new retail palaces. \r\n\r\nOne signature feature of this mall is its glass-covered shopping street, a first for Singapore in its time. Some of the shops you’ll find at Bugis include department store BHG, Topshop, Converse, Kinokuniya, Cotton On, and there’s also a Shaw cinema on the fourth floor. Popular with teenagers and young adults, Bugis Junction has four levels and a basement, and is handily located right above Bugis MRT station.\r\n\r\nHere, you’ll find several cheap eateries as well as more pricey restaurants, offering a range of dining experiences to suit your budget. The five-star InterContinental Hotel is also part of the mall complex, so if you’re planning to book a room at this hotel, you might want to check out the mall’s offerings.', 0, 0, '200 Victoria St Singapore 188021', 1.299369, 103.854919, 'Daily, 10am - 10pm\r\n', 'SHOP', 'BugisJunction.jpg', 'http://www.bugisjunction-mall.com.sg/', NULL, 'S'),
(7, 'Funan Digitalife Mall', 'Gadget gateway\r\n\r\nFunan Digitalife Mall is one of the best places in Singapore to go to, for all things computer and tech-related. Found in the City Hall area between Victoria Street and North Bridge Road, it positions itself as Asia’s leading IT shopping mall – with people coming from afar to have a browse through all of its specialty digital shops. \r\n\r\nA haven for techology geeks, Funan offers the newest and widest range of gadgets, from laptops and desktop computers to printers and digital cameras. One of the best things about the mall is the various deals that you’ll find here, with outlets selling value-for-money products at competitive prices. \r\n\r\nFunan also has free wireless internet, so you can test your latest purchase immediately by going online. The mall also has several restaurants and entertainment options once you’ve had your fill gadget-hunting. ', 0, 0, '109 North Bridge Rd Singapore 179097', 1.291330, 103.850075, 'Daily 10am - 10pm', 'SHOP', 'FunanDigitalifeMall.jpg', 'http://www.funan.com.sg/', NULL, 'CEN'),
(8, 'ION Orchard', 'Where it all comes together\r\n\r\nION Orchard brings together the world’s best-loved brands in flagship, concept and lifestyle stores. Spread over eight levels of shopping space, you can indulge in over 330 retail, F&B and lifestyle stores, which include the six duplex flagships—Cartier, Louis Vuitton, Prada, Dior, Giorgio Armani and Dolce & Gabbana. In addition to a coveted stable of brands, an extensive food hall offers visitors myriad food choices ranging from local favourites to international cuisines.\r\n\r\nTake dining to the skies\r\nLocated at an impressive height of 218 metres above ground level, ION Sky is the new focal point of the city.\r\n\r\nHome to Salt grill & Sky bar, the elegant 6,000 square feet contemporary restaurant is helmed by none other than Australian celebrity chef-restaurateur, Luke Mangan.\r\n\r\nOffering Australian cuisine with a touch of Asian flare, Salt Grill on the 55th floor is the casual version of his award-winning Salt Grill in Sydney. Besides mouthwatering cuisine, food connoisseurs will get to enjoy an unrivalled 360-degree view from the observatory, the highest point on Orchard Road.\r\n\r\nFor an extra touch of romance and glamour, head to the Sky Bar on the 56th floor for pre- or post-dinner drinks.\r\n\r\nTourist Privileges\r\nFlash your passport at the Singapore Visitors Centre at ION Orchard on L1 to redeem a Tourist Wallet featuring attractive privileges from selected brands. Enjoy an exclusive Limousine Airport Transfer when you spend $5,000 in a single receipt.', 0, 0, 'ION Orchard, 2 Orchard Turn Singapore 238801', 1.303895, 103.831940, 'Daily, 10am - 10pm', 'SHOP', 'IONOrchard.jpg', 'www.ionorchard.com', NULL, 'CEN'),
(9, 'Duty Free At Singapore Changi Airport', 'Experience it all at one of the world’s finest airports\r\n\r\nIf you are a visitor coming to Singapore through Changi Airport, or transiting through the city to another destination, be sure not to miss out on all the shopping, dining and entertainment options available before you leave the airport. Having recently won the World’s Best Airport category at the 2013 World Airport Awards, Changi Airport is an all-encompassing venue with over 350 retail and service outlets located across three terminals. Shopping is made even easier, as these terminals are easily accessible via the sky train. ', 0, 0, '60 Airport Boulevard Singapore 819643', 1.355322, 103.988335, 'Terminal 1: 6am -12am \r\nTerminal 2 & Terminal 3: 6am - 1am\r\n(Some shops are open 24 hours)', 'SHOP', 'DutyFreeAtSingaporeChangiAirport.jpg', 'www.changiairport.com/shopping-and-dining/shopping', NULL, 'E'),
(10, 'Science Centre Singapore', 'The Science Centre Singapore , previously known as Singapore Science Centre is a scientific institution in Jurong East, Singapore, specialising in the promotion of scientific and technological education for the general public. With over 850 exhibits spread over eight exhibition galleries, it sees over a million visitors a year today, and over 17 million visitors up to the year 2003 when it celebrated its silver jubilee.', 12, 8, '15 Science Centre Rd Singapore 609081', 1.333194, 103.736130, 'Daily, 10 am – 6 pm\r\nLast admission, 5.15 pm\r\n', 'EDU', 'ScienceCentreSingapore.jpg', 'http://www.science.edu.sg/', 'Omni-Theatre\r\nKidsSTOP\r\nSnow City', 'W');

